window.bookSummaryJSON = "<p><b>A new adventure begins in Erin Hunter’s number-one best-selling Warriors series.</b></p> <p>For many moons, ThunderClan, ShadowClan, RiverClan, and WindClan have lived in peace in their territories around the lake. But now, they must decipher a mysterious prophecy - a message that will send one young medicine cat apprentice on a quest to determine the fate of all the warrior Clans.</p> <p>Full of epic adventure and thrilling intrigue, the beginning of this fifth Warriors series is the perfect introduction for listeners new to the Warriors world. For dedicated fans, it’s a long-awaited return to the era of Bramblestar’s ThunderClan, after the events of Omen of the Stars.</p>"; 
